export const Header = (props) => {
        return(
            <nav className='navbar'>
                <div className='container'>
                    <div className='navbar-header'>
                        <ul>
                            <li><a href='#'>Home</a></li>
                        </ul>
                    </div>
                </div>
            </nav>
        ); 
    };
